        return sum((max(r[i] * count + kitchen_ingredients[i], 0) * ingredient_prices[i] for i in range(3)))
    c = Counter(recipe)
    r = [c['B'], c['S'], c['C']]
    x = (money + kitchen_ingredients[0] * ingredient_prices[0] + kitchen_ingredients[1] * ingredient_prices[1] + kitchen_ingredients[2] * ingredient_prices[2]) // (r[0] * ingredient_prices[0] + r[1] * ingredient_prices[1] + r[2] * ingredient_prices[2])
    (li, ro) = (0, 10 ** 12 + 100)
    feasible_count = 0
    while li <= ro:
        mi = (li + ro) // 2
        if get_price(mi) > money:
            ro = mi - 1
        else:
            feasible_count = mi
            li = mi + 1
    return feasible_count

